function Rating(){
    return (
        <div className="rating">
        <input className="rating-item" type="checkbox">1</input>
        <input className="rating-item"type ="checkbox">2</input>
        <input className="rating-item"type ="checkbox">3</input>
        <input className="rating-item"type ="checkbox">4</input>
        <input className="rating-item"type ="checkbox">5</input>
        </div>
    );
};
export default Rating;
